script: |
  super -f text -I q9617.spq | sort > q9617.out

inputs:
  - name: q9617.spq
    data: |
      SELECT - 12 * - 0 * - - col2 * + - col2 + + - col0 AS col0, + 64 / + - col1 - 91 AS col1 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q9617.out
    data: |
      -46	-92
      -64	-91
      -75	-91
